import React, { Component } from "react";
import Car from "../car/Car";

class Index extends Component {
  state = {
    carList: [],
  };

  componentDidMount() {
    this.retrieveCars();
  }

  retrieveCars() {
    fetch("http://localhost:3000/api/getCars")
      .then((res) => res.json())
      .then((json) => this.setState({ carList: json }));
  }

  render() {
    const { cars } = this.state.carList;
    console.log(cars);

    return (
      <div className="App">
        <div>Welcome to Rent a car online system! </div>

        <br />
        <br />
        <h3> Cars available for rent: </h3>

        <div>
          {this.state.carList.map((car) => {
            return <Car id={car.id} car={car} />;
          })}
        </div>
      </div>
    );
  }
}

export default Index;
